import React from 'react';
import { useState } from 'react';
import {Link} from 'react-scroll'; 
import b4la from '../Images/B4LA.mp4'; 

const Gallery = () => {
    return (
        <section id="gallery">
            <video width="750" height="500" controls >
            <source src={b4la} type="video/mp4"/>
            </video>
        </section>
    ); 
}

export default Gallery;
